import './App.css';
import { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('/members')
      .then((res) => res.json())
      .then((data) => console.log(data));
  }
  , []);

  return (
    <div className="App">
    {
      data ? data.map((member, index) => {
        return (
          <div key={index}>
            <h1>{member}</h1>
          </div>
        )
      }) : <p>Loading...</p>
    }

    </div>
  );
}

export default App;
